window.bookSummaryJSON = "<p><b>She thought it was an ordinary investigation. But it was a werewolf hunt.</b></p> <p>After losing her partner in the line of duty, Agent Sidney Shaw is forced to team up with a renegade bounty hunter. And she doesn’t like it. John Smoke—an incarcerated wild card—is released into her custody, only to push her vaunted training to the limits and toss the FBI playbook out.</p> <p>But a vast hidden network of criminals with the terrifying ability to shape-shift into monsters is spreading its supernatural sickness in the very fabric of human society. Innocents end up dead or missing.</p> <p>Hunting malevolent fiends into the darkest most secret corners of Washington, DC, Smoke and Sid collide with supernatural forces that will stop at nothing to kill them while destroying a nation. <i>Can they set egos aside in time, or will they destroy each other first?</i></p> <p>If you like Jim Butcher’s The Dresden Files and shows such as the <i>X-Files</i> and <i>Supernatural</i>'s suspense-filled action and humor, then this paranormal thriller series is just for you!</p> <p>Attention audiobook listeners! You don't want to miss the masterful storytelling voice of Holly Adams, who takes this already dynamic series to another level. All 10 books, more than 48 hours, for one credit. It's outstanding!</p> <p>More about Craig’s books: Craig Halloran is a <i>USA Today</i> best-selling author and a number one best-selling Amazon author. Sign up for his newsletter and get free books! Yay!</p> <p>Scroll up and grab your copy today!</p> <p>Craig Halloran is a <i>USA Today</i> best-selling author. Learn more about Craig and his works at: craighalloran.com. Sign up for his newsletter and get free books! Yay!</p>"; 
